  1import SwiftUI
  2
  3enum OnboardingStep: Int, CaseIterable {
  4    case welcome
  5    case concepts
  6    case permissions
  7    case analytics
  8    case paywall
  9    case thankYou
 10    case rating
 11
 12    var progressFraction: CGFloat {
 13        CGFloat(rawValue + 1) / CGFloat(Self.allCases.count)
 14    }
 15
 16    func next() -> OnboardingStep? {
 17        OnboardingStep(rawValue: rawValue + 1)
 18    }
 19
 20    func previous() -> OnboardingStep? {
 21        OnboardingStep(rawValue: rawValue - 1)
 22    }
 23}
