 25struct OnboardingView: View {
 26    /// When set, the view is shown in replay mode: pattern setup is skipped and
 27    /// tapping "Continue" on the final step calls this closure instead.
 28    var onReplayDismiss: (() -> Void)? = nil
 29
 30    @Environment(AppState.self) private var appState
 31    @Environment(\.accessibilityReduceMotion) private var reduceMotion
 32    @State private var currentStep: OnboardingStep = .welcome
 33    @State private var showPatternSetup = false
 34
 35    private var isReplay: Bool { onReplayDismiss != nil }
 36
 37    var body: some View {
 38        if showPatternSetup {
 39            PatternSetupView(onComplete: { completeOnboarding() })
 40        } else {
 41            VStack(spacing: 0) {
 42                // Progress bar + back arrow (+ close button in replay mode)
 43                HStack(spacing: 8) {
 44                    Button {
 45                        if let prev = currentStep.previous() {
 46                            withAnimation(animation) { currentStep = prev }
 47                        }
 48                    } label: {
 49                        Image(systemName: "chevron.left")
 50                            .font(.body.weight(.semibold))
 51                            .foregroundStyle(.vaultText)
 52                    }
 53                    .opacity(currentStep != .welcome ? 1 : 0)
 54                    .disabled(currentStep == .welcome)
 55                    .accessibilityIdentifier("onboarding_back")
 56
 57                    Capsule()
 58                        .fill(Color.vaultSecondaryText.opacity(0.2))
 59                        .frame(height: 4)
 60                        .overlay(alignment: .leading) {
 61                            Capsule()
 62                                .fill(Color.accentColor)
 63                                .frame(
 64                                    width: nil,
 65                                    height: 4
 66                                )
 67                                .frame(
 68                                    maxWidth: .infinity,
 69                                    alignment: .leading
 70                                )
 71                                .scaleEffect(x: currentStep.progressFraction, y: 1, anchor: .leading)
 72                        }
 73
 74                    if currentStep == .paywall {
 75                        Button("Skip") { advance() }
 76                            .font(.subheadline.weight(.medium))
 77                            .foregroundStyle(.vaultSecondaryText)
 78                            .accessibilityIdentifier("paywall_skip")
 79                    } else if isReplay {
 80                        Button {
 81                            onReplayDismiss?()
 82                        } label: {
 83                            Image(systemName: "xmark")
 84                                .font(.body.weight(.semibold))
 85                                .foregroundStyle(.vaultSecondaryText)
 86                        }
 87                        .accessibilityLabel("Close")
 88                        .accessibilityIdentifier("onboarding_replay_close")
 89                    }
 90                }
 91                .padding(.horizontal, 20)
 92                .padding(.top, 12)
 93                .padding(.bottom, 8)
 94
 95                // Step content
 96                switch currentStep {
 97                case .welcome:
 98                    WelcomeView(onContinue: { advance() })
 99                case .concepts:
100                    ConceptExplainerView(onContinue: { advance() })
101                case .permissions:
102                    PermissionsView(onContinue: { advance() })
103                case .analytics:
104                    AnalyticsConsentView(onContinue: { advance() })
105                case .paywall:
106                    PaywallStepView(onContinue: { advance() })
107                case .thankYou:
108                    ThankYouView(onContinue: { advance() })
109                case .rating:
110                    RatingView(onContinue: {
111                        if let dismiss = onReplayDismiss {
112                            dismiss()
113                        } else {
114                            withAnimation(animation) { showPatternSetup = true }
115                        }
116                    })
117                }
118            }
119            .background(Color.vaultBackground.ignoresSafeArea())
120        }
121    }
122
123    private var animation: Animation? {
124        reduceMotion ? nil : .easeInOut
125    }
126
127    private func advance() {
128        if let next = currentStep.next() {
129            withAnimation(animation) { currentStep = next }
130        }
131    }
132
133    private func completeOnboarding() {
134        Task {
135            await appState.completeOnboarding()
136        }
137    }
138}
