332    // MARK: - Actions
333
334    private func handlePatternComplete(_ pattern: [Int]) {
335        patternSetupLogger.debug("Pattern completed in \(String(describing: step), privacy: .public) step, count: \(pattern.count)")
336        
337        switch step {
338        case .create:
339            let result = PatternValidator.shared.validate(pattern, gridSize: patternState.gridSize)
340            validationResult = result
341
342            patternSetupLogger.debug("Validation: isValid=\(result.isValid), errors=\(result.errors.count), warnings=\(result.warnings.count)")
343
344            if result.isValid {
345                UINotificationFeedbackGenerator().notificationOccurred(.success)
346                errorMessage = nil
347                firstPattern = pattern
348                step = .confirm
349                patternState.reset()
350
351                patternSetupLogger.debug("Pattern valid, moving to confirm step")
352            } else {
353                patternSetupLogger.debug("Pattern invalid, resetting")
354                patternState.reset()
355            }
356
357        case .confirm:
358            patternSetupLogger.debug("Confirming pattern, match=\(pattern == firstPattern)")
359            
360            if pattern == firstPattern {
361                // Patterns match - save and continue
362                UINotificationFeedbackGenerator().notificationOccurred(.success)
363                errorMessage = nil
364                patternSetupLogger.debug("Patterns match, saving")
365                // Generate the phrase now, before saving
366                if !useCustomPhrase {
367                    generatedPhrase = RecoveryPhraseGenerator.shared.generatePhrase()
368                }
369                savePattern(pattern)
370            } else {
371                // Patterns don't match - show error and reset
372                UINotificationFeedbackGenerator().notificationOccurred(.error)
373                patternSetupLogger.debug("Patterns don't match, resetting")
374                errorMessage = "Patterns don't match. Try again."
375                patternState.reset()
376                Task {
377                    try? await Task.sleep(nanoseconds: 2_500_000_000)
378                    await MainActor.run { errorMessage = nil }
379                }
380            }
381
382        default:
383            break
384        }
385    }
386
387    private func savePattern(_ pattern: [Int]) {
388        patternSetupLogger.debug("Saving pattern, gridSize=\(patternState.gridSize)")
389        isSaving = true
390
391        Task {
392            let phrase = useCustomPhrase ? customPhrase.trimmingCharacters(in: .whitespacesAndNewlines) : generatedPhrase
393            let result = await coordinator.savePattern(pattern, gridSize: patternState.gridSize, phrase: phrase)
394
395            await MainActor.run {
396                switch result {
397                case .success(let key):
398                    patternSetupLogger.debug("Pattern saved successfully")
399                    EmbraceManager.shared.addBreadcrumb(category: "onboarding.complete", data: ["gridSize": patternState.gridSize])
400
401                    isSaving = false
402                    appState.currentVaultKey = VaultKey(key)
403                    let letters = GridLetterManager.shared.vaultName(for: pattern)
404                    appState.updateVaultName(letters.isEmpty ? "Vault" : "Vault \(letters)")
405                    step = .recovery
406
407                case .duplicatePattern:
408                    patternSetupLogger.info("Vault already exists for this pattern")
409                    isSaving = false
410                    step = .create
411                    patternState.reset()
412                    firstPattern = []
413                    validationResult = PatternValidationResult(
414                        isValid: false,
415                        errors: [.custom("This pattern is already used by another vault. Please choose a different pattern.")],
416                        warnings: [],
417                        metrics: PatternSerializer.PatternMetrics(
418                            nodeCount: pattern.count,
419                            directionChanges: 0,
420                            startsAtCorner: (Set(pattern).count != 0),
421                            endsAtCorner: false,
422                            crossesCenter: false,
423                            touchesAllQuadrants: false
424                        )
425                    )
426
427                case .error(let message):
428                    patternSetupLogger.error("Error saving pattern: \(message, privacy: .public)")
429                    isSaving = false
430                    errorMessage = "Failed to save pattern. Please try again."
431                    step = .create
432                    patternState.reset()
433                    firstPattern = []
434                }
435            }
436        }
437    }
438    
439    private func validateCustomPhrase(_ phrase: String) {
440        guard !phrase.isEmpty else {
441            customPhraseValidation = nil
442            return
443        }
444        customPhraseValidation = RecoveryPhraseGenerator.shared.validatePhrase(phrase)
445    }
446
447    private func dismissKeyboard() {
448        UIApplication.shared.sendAction(
449            #selector(UIResponder.resignFirstResponder),
450            to: nil,
451            from: nil,
452            for: nil
453        )
454    }
455}
