  1import SwiftUI
  2import os.log
  3
  4private let logger = Logger(subsystem: "app.vaultaire.ios", category: "ContentView")
  5
  6struct ContentView: View {
  7    @Environment(AppState.self) private var appState
  8    @Environment(DeepLinkHandler.self) private var deepLinkHandler
  9    @Environment(\.accessibilityReduceMotion) private var reduceMotion
 10
 11    @State private var showUnlockTransition = false
 12    @State private var isLockingInProgress = false
 13
 14    private let capturePollIntervalNanoseconds: UInt64 = 1_000_000_000
 15    private let screenshotLockDebounceIntervalNanoseconds: UInt64 = 200_000_000  // 200ms debounce
 16
 17    private var enforceCaptureLocking: Bool {
 18        #if DEBUG
 19        false
 20        #else
 21        true
 22        #endif
 23    }
 24
 25    var body: some View {
 26        ZStack {
 27            // Static background: correct from frame 1, trait-independent.
 28            appState.launchBackgroundColor
 29                .ignoresSafeArea()
 30
 31            Group {
 32                if appState.showOnboarding {
 33                    OnboardingView()
 34                } else if appState.isLoading {
 35                    LoadingView()
 36                } else if appState.isUnlocked {
 37                    VaultView()
 38                        .transition(.identity)
 39                } else {
 40                    PatternLockView()
 41                }
 42            }
 43            #if DEBUG
 44            .onAppear {
 45                if appState.isMaestroTestMode && !appState.isUnlocked && !appState.showOnboarding {
 46                    appState.maestroTestUnlock()
 47                }
 48            }
 49            #endif
 50
 51            // Vault door unlock overlay  always present, opacity-controlled.
 52            // Using direct opacity instead of conditional insertion avoids
 53            // a timing issue where the overlay never reaches full opacity.
 54            Color.vaultBackground
 55                .ignoresSafeArea()
 56                .overlay {
 57                    Image(systemName: "shield.fill")
 58                        .font(.system(size: 64))
 59                        .foregroundStyle(Color.accentColor)
 60                        .scaleEffect(showUnlockTransition ? 1.2 : 1.0)
 61                }
 62                .opacity(showUnlockTransition ? 1 : 0)
 63                .allowsHitTesting(showUnlockTransition)
 64
 65            // Screenshot detected: full-screen overlay (covers UI before lock)
 66            if appState.screenshotDetected {
 67                Color.vaultBackground
 68                    .ignoresSafeArea()
 69            }
 70        }
 71        .fullScreenCover(isPresented: Binding(
 72            get: { deepLinkHandler.pendingSharePhrase != nil },
 73            set: { if !$0 { deepLinkHandler.clearPending() } }
 74        )) {
 75            SharedVaultInviteView()
 76                .environment(appState)
 77                .environment(deepLinkHandler)
 78                .environment(SubscriptionManager.shared)
 79        }
 80        .ignoresSafeArea(.keyboard)
 81        .preventScreenshots()
 82        .onChange(of: appState.isUnlocked) { _, isUnlocked in
 83            guard isUnlocked else {
 84                // Safety: ensure unlock overlay is dismissed when vault locks,
 85                // even if the fade-out animation was interrupted.
 86                showUnlockTransition = false
 87                // Stop inactivity monitoring when vault locks
 88                InactivityLockManager.shared.stopMonitoring()
 89                return
 90            }
 91
 92            // Start inactivity monitoring when vault unlocks
 93            InactivityLockManager.shared.startMonitoring {
 94                logger.info("Inactivity timeout reached, locking vault")
 95                EmbraceManager.shared.addBreadcrumb(category: "app.locked", data: ["trigger": "inactivity_timeout"])
 96                appState.lockVault()
 97            }
 98
 99            // Trigger silent background backup if enabled and overdue
100            if let key = appState.currentVaultKey {
101                iCloudBackupManager.shared.performBackupIfNeeded(with: key.rawBytes)
102            }
103
104            if UIScreen.main.isCaptured {
105                lockForCaptureViolation(trigger: "recording_unlock_check")
106            }
107
108            guard !reduceMotion else { return }
109            showUnlockTransition = true
110            // Delay one frame so the overlay renders at full opacity before fading.
111            DispatchQueue.main.async {
112                withAnimation(.easeOut(duration: 0.9)) {
113                    showUnlockTransition = false
114                }
115            }
116        }
117        // Safety: when the app becomes active, clear any stuck overlays.
118        // Covers edge cases where background suspension interrupts animations
119        // or leaves screenshotDetected stuck.
120        .onReceive(NotificationCenter.default.publisher(for: UIApplication.didBecomeActiveNotification)) { _ in
121            if !appState.isUnlocked {
122                showUnlockTransition = false
123            }
124            if appState.screenshotDetected && !appState.isUnlocked {
125                appState.screenshotDetected = false
126            }
127            if appState.isUnlocked && UIScreen.main.isCaptured {
128                lockForCaptureViolation(trigger: "recording_active_check", showOverlayBeforeLock: true)
129            }
130        }
131        // Screenshot detection  locks vault when user takes a screenshot
132        .onReceive(NotificationCenter.default.publisher(for: UIApplication.userDidTakeScreenshotNotification)) { _ in
133            lockForCaptureViolation(trigger: "screenshot", showOverlayBeforeLock: true)
134        }
135        // Screen recording detection
136        .onReceive(NotificationCenter.default.publisher(for: UIScreen.capturedDidChangeNotification)) { notification in
137            guard let screen = notification.object as? UIScreen else { return }
138            if screen.isCaptured {
139                lockForCaptureViolation(trigger: "recording_notification", showOverlayBeforeLock: true)
140            }
141        }
142        .task {
143            guard enforceCaptureLocking else { return }
144            while !Task.isCancelled {
145                try? await Task.sleep(nanoseconds: capturePollIntervalNanoseconds)
146                guard !Task.isCancelled else { break }
147                if UIScreen.main.isCaptured {
148                    lockForCaptureViolation(trigger: "recording_poll", showOverlayBeforeLock: true)
149                }
150            }
151        }
152        // Lock only when the app actually enters background.
153        // `willResignActive` also fires for transient system UI (e.g. import pickers),
154        // which can interrupt in-app file import flows.
155        .onReceive(NotificationCenter.default.publisher(for: UIApplication.didEnterBackgroundNotification)) { _ in
156            #if DEBUG
157            if appState.isMaestroTestMode { return }
158            #endif
159            logger.debug("App entered background, locking vault")
160            EmbraceManager.shared.addBreadcrumb(category: "app.locked", data: ["trigger": "background"])
161            appState.lockVault()
162        }
163        #if DEBUG
164        // Simulator: Cmd+S doesn't post userDidTakeScreenshotNotification.
165        // Shake device (Ctrl+Cmd+Z in simulator) to simulate a screenshot for testing.
166        .onReceive(NotificationCenter.default.publisher(for: UIDevice.deviceDidShakeNotification)) { _ in
167            logger.debug("Simulated screenshot via shake")
168            appState.screenshotDetected = true
169            Task {
170                try? await Task.sleep(nanoseconds: 100_000_000)
171                appState.lockVault()
172            }
173        }
174        #endif
175    }
176
177    private func lockForCaptureViolation(trigger: String, showOverlayBeforeLock: Bool = false) {
178        guard enforceCaptureLocking else { return }
179        guard appState.isUnlocked else { return }
180
181        // Debounce: prevent concurrent/rapid locking attempts
182        guard !isLockingInProgress else {
183            logger.debug("Lock already in progress, debouncing trigger: \(trigger, privacy: .public)")
184            return
185        }
186
187        logger.info("Capture violation detected (\(trigger, privacy: .public)), locking vault")
188        EmbraceManager.shared.addBreadcrumb(category: "app.locked", data: ["trigger": trigger])
189
190        isLockingInProgress = true
191
192        if showOverlayBeforeLock {
193            appState.screenshotDetected = true
194            Task { @MainActor in
195                try? await Task.sleep(nanoseconds: 100_000_000)
196                guard appState.isUnlocked else {
197                    isLockingInProgress = false
198                    return
199                }
200                appState.lockVault()
201                // Reset after debounce interval to allow future locks
202                try? await Task.sleep(nanoseconds: screenshotLockDebounceIntervalNanoseconds)
203                isLockingInProgress = false
204            }
205            return
206        }
207
208        appState.lockVault()
209        // Reset debounce flag after interval
210        Task { @MainActor in
211            try? await Task.sleep(nanoseconds: screenshotLockDebounceIntervalNanoseconds)
212            isLockingInProgress = false
213        }
214    }
215}
216
217#if DEBUG
218// Extend UIDevice to detect shake gestures for debug screenshot simulation
219extension UIDevice {
220    static let deviceDidShakeNotification = Notification.Name("deviceDidShakeNotification")
221}
222
223extension UIWindow {
224    open override func motionEnded(_ motion: UIEvent.EventSubtype, with event: UIEvent?) {
225        super.motionEnded(motion, with: event)
226        if motion == .motionShake {
227            NotificationCenter.default.post(name: UIDevice.deviceDidShakeNotification, object: nil)
228        }
229    }
230}
231#endif
